(function(){window.addEventListener("message",function(event){if(event.data==="logout"){clearCookieAll()}});function clearCookieAll(){function destructionPath(path){var paths=[],pathRouter="",dPaths=path.split("/").filter(function(item){if(item===""){return false}return true});paths.push("/");dPaths.forEach(function(item){pathRouter+="/"+item;paths.push(pathRouter)});return paths}function clearCookie(key,path){document.cookie=key+"=;expires="+exp.toGMTString()+";path="+path}var exp=new Date();exp.setTime(exp.getTime()-1);var paths=destructionPath(location.pathname);var cookies=document.cookie.split(";");for(var index in cookies){paths.forEach(function(path){clearCookie(cookies[index].split("=")[0],path)})}}})();